function Navbar() {
  return (
    <nav className="navbar">
      <div className="container">
        <ul className="nav-links">
          <li><a href="#program">Quien soy</a></li>
          <li><a href="#results">Resultados</a></li>
          <li><a href="#faq">FAQ</a></li>
          <li><a href="#faq">wsp</a></li>
          <h1>Logo</h1>
        </ul>
      </div>
    </nav>
  );
}
export default Navbar;
